import React from "react";
import { Tile } from "./Tile"; // Import the Tile component

export const TileList = ({ data }) => {
  return (
    <div>
      {data.map((object, index) => {
        const { name, ...rest } = object; // Destructure name and use ...rest syntax for description

        return <Tile key={index} name={name} description={rest} />; // Render Tile component with props
      })}
    </div>
  );
};
